	add("scorpion", "{\"term\":\"scorpion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027scorpion\u0027 from Latin \u0027scorpio\u0027 ultimately from Ancient greek (to 1453) \u0027σκορπίος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various arachnids of the order \u0027Scorpiones\u0027, related to the spiders, characterised by two large front pincers and a curved tail with a poisonous sting in the end\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An ancient military engine for hurling stones and other missiles\", \"priority\":2}]}, \"synonyms\":{}}");

	add("scorpionfish", "{\"term\":\"scorpionfish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|scorpion|fish|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the family Scorpaenidae of mostly marine fish, including many of the world\u0027s most venomous species, the \u0026quot;sting\u0026quot; taking the form of sharp spines coated with venomous mucus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scorpionweed", "{\"term\":\"scorpionweed\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|scorpion|weed|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant of the genus \u0027Phacelia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Natt Noyes Dodge \u0026amp; Jeanne R. Janish, \u0027Flowers of the Southwest deserts\u0027, page 109\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003dgH2vsLkNQGQC]\u0026lt;/sup\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The name \u0027\u0027scorpionweed\u0027\u0027 comes from the curling habit of the blossoming flower heads which somewhat resemble the flexed tail of a scorpion in striking position\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Linda Kershaw, \u0027Rare vascular plants of Alberta\u0027, page 184\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003dcCUNmrHbMHsC]\u0026lt;/sup\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Lyall\u0027s \u0027\u0027scorpionweed\u0027\u0027 is closely related to the more common species silky \u0027\u0027scorpionweed\u0027\u0027 (\u0027Phacelia sericea\u0027 (Graham) A. Gray) and was once considered a variety of that species\", \"priority\":5}]}, \"synonyms\":{}}");

	add("scorpius", "{\"term\":\"scorpius\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027scorpius\u0027 (scorpion)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"symbol ♏\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A constellation of the zodiac, roughly shaped like a scorpion. Its brightest star is the red giant Antares\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Scorpio\", \"priority\":3}]}, \"synonyms\":{}}");

	add("scortation", "{\"term\":\"scortation\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"\u0027\u0027 (scortation-) from Latin \u0027\u0027 (scortat-) the past participle stem of \u0027scortari\u0027 (associate with prostitutes) from \u0027scortum\u0027 (prostitute)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lewdness, fornicatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"more opposite to conjugal love than the common \u0027\u0027scortation\u0027\u0027 , which is called simple adultery; and that it is a deprivation of every faculty and inclination to conjugal life, which is implanted in christians from nativity, may be evinced by arguments which will have great weight with the reason of a wise man\", \"priority\":2}]}, \"synonyms\":{}}");

