	add("scotch", "{\"term\":\"scotch\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Contraction of \u0027scottish\u0027 () The tape brand is supposedly after its cheapness (as the Scottish were stereotyped as cheap).The chess opening is supposedly after its having been played in a correspondence game between Edinburgh, Scotland, and London, England.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The people of Scotland\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Scotch\u0027\u0027 are a hardy bunch\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Whisky distilled in Scotland, especially from malted barley\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Paul has drunk a lot of \u0027\u0027Scotch\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any variety of Scotch\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"My favorite \u0027\u0027Scotches\u0027\u0027 are Glenlivet and Laphroaig\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A glass of Scotch\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Gimme a \u0027\u0027Scotch\", \"priority\":8}]}, \"synonyms\":{}}");

