	add("scoundrel", "{\"term\":\"scoundrel\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Possibly related to northern English or Scottish scunner: \u0026quot;to shrink back in fear or loathing\u0026quot; (Encyclopædia Britannica 1911).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mean, worthless fellow; a rascal; a villain; a person without honour or virtue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Go, if your ancient, but ignoble blood / Has crept through \u0027\u0027soundrels\u0027\u0027 ever since the flood\", \"priority\":3}]}, \"synonyms\":{}}");

	add("scourge", "{\"term\":\"scourge\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027escorgier\u0027 (to whip) from excorrigo|excorrigere, consisting of ex- + Latin \u0027corrigo\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A source of persistent trouble such as pestilence that causes pain and suffering or widespread destruction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A means to inflict such pain or destruction\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"What \u0027\u0027scourge\u0027\u0027 for perjury / Can this dark monarchy afford false Clarence\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dAmerica’s poverty line is $63 a day for a family of four. In the richer parts of the emerging world $4 a day is the poverty barrier. But poverty’s \u0027\u0027scourge\u0027\u0027 is fiercest below $1.25 ([\u0026amp;hellip;]): people below that level live lives that are poor, nasty, brutish and short\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A whip, often of leather\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Chapma\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Up to coach then goes / The observed maid, takes both the \u0027\u0027scourge\u0027\u0027 and reins\", \"priority\":8}]}, \"synonyms\":{}}");

