	add("scouting", "{\"term\":\"scouting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of one who scouts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1935\u0027\u0027, \u0027State Publication\u0027 (issues 136-145, page 73\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Careful \u0027\u0027scoutings\u0027\u0027 by the State Department of Agriculture and Markets were made in 1935, to determine the limits of invasio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The :wikipedia:Scout Scout Movemen\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The activities of boy scouts and girl scouts\", \"priority\":5}]}, \"synonyms\":{}}");

	add("scouts", "{\"term\":\"scouts\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A worldwide youth movement with the aim of supporting young people in their physical, mental and spiritual development, so that they may play a constructive role in the society [http://www.scout.org\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, Ernest Thompson Seton, \u0027The Worlds of Ernest Thompson Seton\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Lord Baden-Powell of England is generally given credit for founding the \u0027\u0027Scouts\u0027\u0027. There is no doubt he founded the Scout movement in England along military\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Tim Jeal, \u0027Baden-Powell\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In that year Percy Everett suggested that to prevent the \u0027\u0027Scouts\u0027\u0027 being squeezed out (as they might be if cadet training were to become compulsory for all boys\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Philippa Levine, \u0027Gender and Empire\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Boer War hero Robert Baden-Powell founded the \u0027\u0027Scouts\u0027\u0027 in 1907 so that young men might put military and colonial frontier discipline to work in suburban peacetime\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Tess Cosslett, \u0027Talking Animals in British Children\u0027s Fiction 1786-1914\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Baden-Powell did not himself write animal stories, but when he decided to form an organisation for younger boys, modelled on the \u0027\u0027Scouts\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any of the national \u0027\u0027Scouts\u0027\u0027 organizations such as the w:Boy Scouts of Boy Scouts of America\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, \u0027The Australian Journal of Social Issues\u0027, Australian Council of Social Service, page 46\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The most common criterion of effectiveness quoted from within the Scout Movement is that of the large number of former \u0027\u0027Scouts\u0027\u0027 who become successful in later [life …\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Rannveig Traustadóttir and Kelley Johnson (editors), \u0027Women with Intellectual Disabilities: Finding a Place in the World\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Scouts\u0027\u0027 promise to make a real effort to help Mrs Tuttleby find a Scout group which will appoint her as a leader with a restricted warrant\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Brian Galligan, Winsome Roberts, and Gabriella Trifiletti, \u0027Australians and Globalisation: The Experience of Two Centuries\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Civic projects were sponsored through service clubs such as Rotary, Apex and Lions. Children might attend Brownies or Cubs, the Guides or the \u0027\u0027Scouts\u0027\u0027. By the 1960s Australian cultural activities were also being put on an international footing\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Anne E. Blair, \u0027Ruxton: A Biography\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Scouts\u0027\u0027 also took him further afield than his native Melbourne. At the end of 1938, he sailed to Sydney for the Scout Jamboree on the Canberra\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Dr Winsome Roberts and Brian Galligan, \u0027Australian Citizenship\u0027, page 95\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"and in 2002, the Guides, \u0027\u0027Scouts\u0027\u0027, Returned and Serves League and Surf Life Saving clubs all sponsored Harmony Day\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, John Buchan, \u0027Canadian Occasions: addresses\u0027, page 148\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"wherever I have gone I have found companies of \u0027\u0027Scouts\u0027\u0027 inspired by the true Scout tradition\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Shimon Redlich, \u0027Together and Apart in Brzezany: Poles, Jews, and Ukrainians, 1919-1945\u0027, page 48\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"in the spring of 1919, a number of local \u0027\u0027Scouts\u0027\u0027 somehow got hold of a few guns and assisted the Polish soldiers\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Besides such common scouting activities as hikes and summer camps, the \u0027\u0027Scouts\u0027\u0027 participated in various Polish national festivals\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"The w:Selous Selous Scouts, a special forces regiment of the former Rhodesian Army\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Ron Reid-Daly and Peter Stiff, \u0027Selous Scouts: Top Secret War\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Turning the tables, the \u0027\u0027Scouts\u0027\u0027 bit the biter by blowing up\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, Peter Abbott and Philip Botham, \u0027Modern African Wars\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"Column strength never exceeded 72 men, and the results achieved were out of all proportion. In alone the \u0027\u0027Scouts\u0027\u0027 notched up 1,257 kills, only 180 of them internal\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Leroy Thompson, \u0027SAS: Great Britain\u0027s Elite Special Air Service\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"As the terrorists in Rhodesia relied heavily on letters for communication, the \u0027\u0027Scouts\u0027\u0027 often captured a bonanza of intelligence\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Peter J. H. Petter-Bowyer, \u0027Winds of Destruction: The Autobiography of a Rhodesian Combat Pilot\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Scouts\u0027\u0027 recognised that dead CTs were either abandoned or buried and forgotten, whereas the living wounded presented an unwanted burden\", \"priority\":34}]}, \"synonyms\":{}}");

